        const readings = rawData.split(readingsSeperator + '\n')
        readings.pop();
        readings.splice(0,1);
        const data = []
        readings.forEach(reading => {
            const info = {}
            
            reading = reading.split('\n')
            reading.pop();
            reading.forEach(line => {
                const [key, rawValues] = line.split(':')[4].split('=')
                const values = []
                rawValues.split(',').forEach(value => values.push(parseFloat(value.trim())))
                info[key.trim()] = values
            })
            data.push(info)
        })
        function showReading(index) {
            document.getElementById('blob').innerHTML = readings[index]
            const canvas = document.getElementById('canvas')
            const ctx = canvas.getContext('2d')

            ctx.clearRect(0, 0, canvas.width, canvas.height)

            ctx.strokeStyle = 'black'
            ctx.fillStyle = 'black'
            ctx.lineWidth = 2

            const borderSize = 10
            const rectSize = 4
            ctx.strokeRect(borderSize, borderSize, canvas.width - 2*borderSize, canvas.height - 2*borderSize)
            const xMod = Math.floor((data[index].curve0[0] + data[index].curve1[0] + data[index].curve2[0]) / 3 / 61) * 61
            const yMod = Math.floor((data[index].curve0[1] + data[index].curve1[1] + data[index].curve2[1]) / 3 / 61) * 61

            function toCanvasX(x) {
                return borderSize + (x - xMod)/61*(canvas.width-2*borderSize)
            }
            function toCanvasY(y) {
                return borderSize + (61 - (y - yMod))/61*(canvas.height-2*borderSize)
            }

            ctx.fillRect(toCanvasX(data[index].curve0[0])-rectSize, toCanvasY(data[index].curve0[1])-rectSize, 2*rectSize, 2*rectSize)
            ctx.fillRect(toCanvasX(data[index].curve2[0])-rectSize, toCanvasY(data[index].curve2[1])-rectSize, 2*rectSize, 2*rectSize)
            ctx.beginPath()
            ctx.moveTo(toCanvasX(data[index].curve0[0]), toCanvasY(data[index].curve0[1]))
            ctx.quadraticCurveTo(toCanvasX(data[index].curve1[0]), toCanvasY(data[index].curve1[1]), toCanvasX(data[index].curve2[0]), toCanvasY(data[index].curve2[1]))
            ctx.stroke()

            ctx.fillStyle = 'red'
            ctx.fillRect(toCanvasX(data[index].pos[0])-rectSize, toCanvasY(data[index].pos[1])-rectSize, 2*rectSize, 2*rectSize)

            ctx.fillStyle = 'blue'
            const [t, c0, c1, c2] = [data[index].t, data[index].curve0, data[index].curve1, data[index].curve2]
            function bez(i) { return (1-t)*((1-t)*c0[i] + t*c1[i]) + t*((1-t)*c1[i] + t*c2[i]) }
            ctx.fillRect(toCanvasX(bez(0))-rectSize, toCanvasY(bez(1))-rectSize, 2*rectSize, 2*rectSize)

            ctx.strokeStyle = 'red'
            ctx.beginPath()
            ctx.moveTo(toCanvasX(data[index].pos[0]), toCanvasY(data[index].pos[1]))
            ctx.lineTo(toCanvasX(data[index].pos[0] + data[index].offsetVec[0]), toCanvasY(data[index].pos[1] + data[index].offsetVec[1]))
            ctx.stroke()
            
            ctx.strokeStyle = 'blue'
            ctx.beginPath()
            ctx.moveTo(toCanvasX(bez(0)), toCanvasY(bez(1)))
            ctx.lineTo(toCanvasX(bez(0) + data[index].tangentVec[0]*10), toCanvasY(bez(1) + data[index].tangentVec[1]*10))
            ctx.stroke()
            
            ctx.strokeStyle = 'green'
            ctx.beginPath()
            ctx.moveTo(toCanvasX(data[index].pos[0]), toCanvasY(data[index].pos[1]))
            ctx.lineTo(toCanvasX(data[index].pos[0] + data[index].velocity[0]*10), toCanvasY(data[index].pos[1] + data[index].velocity[1]*10))
            ctx.stroke()

            ctx.strokeStyle = 'purple'
            ctx.beginPath()
            ctx.moveTo(toCanvasX(data[index].pos[0]), toCanvasY(data[index].pos[1]))
            ctx.lineTo(toCanvasX(data[index].pos[0] + data[index].offsetVel[0]*100), toCanvasY(data[index].pos[1] + data[index].offsetVel[1]*100))
            ctx.stroke()

            ctx.strokeStyle = 'yellow'
            ctx.beginPath()
            ctx.moveTo(toCanvasX(bez(0)), toCanvasY(bez(1)))
            ctx.lineTo(toCanvasX(bez(0) + data[index].tangentVel[0]*10), toCanvasY(bez(1) + data[index].tangentVel[1]*10))
            ctx.stroke()
        }
        showReading(0)
        document.getElementById('slider').setAttribute('max', data.length - 1)
        document.getElementById('slider').oninput = function() { showReading(this.value) }
    </script>
